// SPDX-License-Identifier: MIT
pragma solidity 0.8.10;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ContextUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

import "./interfaces/IToken.sol";

contract Character is Initializable, ReentrancyGuardUpgradeable, ContextUpgradeable, OwnableUpgradeable {
    IToken private  _tokenContract;


    //account =>level
    mapping(address => uint32) private _characterLevel;
    uint[] private _levelPower;
    uint[] private _levelCost;

    event Upgrade(address indexed account, uint32 level);

    function initialize(address tokenContract, address owner) public initializer {
        __ReentrancyGuard_init();
        _tokenContract = IToken(tokenContract);
        __Ownable_init();
        transferOwnership(owner);

    }

    function upgrade() external nonReentrant {
        uint32 nextLevel = _characterLevel[_msgSender()] + 1;
        uint cost = _levelCost[nextLevel];
        require(cost > 0, "max level reached");
        require(cost <= _tokenContract.balanceOf(_msgSender()), "not enough tokens");
        _tokenContract.burn(_msgSender(), cost);
        _characterLevel[_msgSender()] = nextLevel;
        emit Upgrade(_msgSender(), nextLevel);
    }

    function getAccountPower(address account) external view returns (uint){
        return _levelPower[_characterLevel[account]];
    }

    function getAccountLevel(address account) external view returns (uint32) {
        return _characterLevel[account];
    }

    function getLevelCost(uint level) public view returns (uint) {
        return _levelCost[level];
    }

    function _buildLevels() public onlyOwner {

    }
}
